$(function(){window.innerWidth>1200&&$(window).on("mousemove",function(n){var a=$(window).width(),t=$(window).height(),o=.5-n.pageX/a,i=.5-n.pageY/t;$(".parallax").each(function(n,a){var t=parseInt($(a).data("offset")),e="translate3d("+Math.round(o*t)+"px,"+Math.round(i*t)+"px, 0px";$(a).css({transform:e})})})});